  };

  function onChange() {
    setState(!state);
    console.log(state);
  }

  return (
    <div className='container'>
      <div className='innercontainer'>
        <div className='front face'>FRONT</div>
        <div className='back face'>BACK</div>
      </div>
    </div>
  );
}
export default Survey;
